import axios from "axios";
import React from "react";
import CardFavorites from "./CardFavorites.jsx"

const Favorites = () => {

    const [favorites, setFavorites] = React.useState([])

    React.useEffect(() => {
        axios.get("/api/auth/me")
        .then((user) => user.data)
        .then((favorites)=> {
            setFavorites(favorites.favoritesID)
        })
    }, [])
    console.log(favorites)

    return(
        <div>
            <CardFavorites />
        {favorites.map((fav, i) => {
            console.log(fav)
        })}
        </div>
    )
}

export default Favorites;
